function query(name) {
  this.state.components.fillter((e) => {
    return e.name !== name;
  });
}

getTableData.value:
function getTableData() {
  return new Promise((resolve, reject) => {
    this.dataSourceMap['timeData'].load().then((res) => {
      resolve({ result: [], page: { total: 0 } });
    });
  });
}

